import React from 'react'
import ReactDom from 'react-dom'

// CSS
import './index.css'

function BookList() {
  return (
    <section className='booklist'>
      <Book />
    </section>
  )
}

const Book = () => {
  return <article className='book'>
    <img src='https://images-na.ssl-images-amazon.com/images/I/81kv0vHJ0QL._AC_UL240_SR240,240_.jpg' alt=''/>
    <h1>TensorFlow book</h1>
    <h4>John Reed</h4>
  </article>
}

ReactDom.render(<BookList />, document.getElementById('root'))
